import React, { useState } from 'react';
import IntakeTab from './components/IntakeTab';
import LogsTab from './components/LogsTab';

const tabStyle = {
  display: 'flex',
  borderBottom: '2px solid #eee',
  marginBottom: 24,
};
const tabButtonStyle = (active) => ({
  padding: '12px 32px',
  cursor: 'pointer',
  border: 'none',
  background: active ? '#fff' : '#f6f8fa',
  borderBottom: active ? '2px solid #1976d2' : '2px solid transparent',
  color: active ? '#1976d2' : '#333',
  fontWeight: active ? 600 : 400,
  fontSize: 18,
  outline: 'none',
  transition: 'all 0.2s',
});

function App() {
  const [activeTab, setActiveTab] = useState('intake');

  return (
    <div style={{ maxWidth: 700, margin: '40px auto', padding: 32, background: '#fff', borderRadius: 16, boxShadow: '0 4px 24px rgba(0,0,0,0.08)', fontFamily: 'Segoe UI, Arial, sans-serif' }}>
      <h1 style={{ textAlign: 'center', color: '#1976d2', marginBottom: 32 }}>Multi-Format Intake Agent</h1>
      <div style={tabStyle}>
        <button style={tabButtonStyle(activeTab === 'intake')} onClick={() => setActiveTab('intake')}>Intake</button>
        <button style={tabButtonStyle(activeTab === 'logs')} onClick={() => setActiveTab('logs')}>Logs</button>
      </div>
      {activeTab === 'intake' && <IntakeTab />}
      {activeTab === 'logs' && <LogsTab />}
    </div>
  );
}

export default App;
